            {
                id : 8,
                title : 'Saat & Aksesuar',
                slug : 'saat-aksesuar'
            },
            {
                id : 9,
                title : 'Elektronik',
                slug : 'elektronik'
            },
            {
                id : 10,
                title : 'Spor & Outdoor',
                slug : 'spor-outdoor'
            }
        ]
    }

    render(){
        return(
           <nav>
               <ul>
                   { this.state.menus.map((menu,index) =>
                       <li><a href={menu.slug}>{menu.title}</a></li>
                   )}
               </ul>
           </nav>
        );
    }
}

export default Search;
